import React, { Component } from 'react'
import { Button, TextField } from '@material-ui/core';


class Client extends Component {
    constructor(props) {
        super(props)
        this.state = {
            name: '',
            table: ''
        }
    }

    render() {
        return(
        <div>
        <p> Informações do cliente: </p>
        <TextField type='text' placeholder='Nome' name='name' value={this.state.name} />
        <TextField type='number' placeholder='Mesa' name='name' value={this.state.name} />
        </div>
        )
    }

}


export default Client
